	Signup.cloneTablesToDatabase = function(sqlQuery) {
		
		var deferred = Modules.Q.defer();

		Modules.Database.query({
            query: sqlQuery,
        }).then(function (result) {            
			deferred.resolve(result);
        }, function (err) {
			console.log('Error cloning tables', err);
		});

		return deferred.promise;

	};


